414	http://army.podfm.ru/rss/rss.xml	Армейские Воспоминания	PodFM.ru	"Армейские Воспоминания" — это не просто воспоминания, это первый авторский подкаст об армии.  Ведут подкаст опытные офицеры в запасе и их друзья.  В программе: — "Основная часть": аналитика военных действий и повседневной жизни армии России. Выражение личного мнения о происходящем вокруг и внутри армий мира.  — "РККА": Реформа Компактно-Карманной Армии - наблюдения за ходом военной реформы. — "миК-граунд": реальные мини рассказы из армейской жизни с юмором, сарказмом и всерьёз. А также байки от друзей. — "Советы мамам": советы мамам от бывалых офицеров, сержантов, солдат. — "Армейская курилка": ликбез от опытных военных для всех, не взирая военный Вы или нет. — "Железяка": все о вооружении и военной технике устами  офицеров. — "Розовая Железяка": как видит и воспринимает вооружение и военную технику женщина. — "Про-армейские новости": обсуждение самых свежих новостей об армии России и мира. — "Армейское перо": литературные и документальные произведения об армии в виде аудио-рассказов. — "Чтобы помнили": коротко о героях, знаменательных датах в истории ВС, орденах, медалях, командирах и просто о солдатах.  Темы программы, как и выпуски — не регулярны. В одном выпуске затрагиваются не все сразу темы.  P.S. У России два союзника — Армия и Флот!	http://file2.podfm.ru/5/52/523/5237/images/lent_5144_big_76.jpg	\N	\N
