or two reasons. 1) I am doing a special dance 'Rap' episode 2) I am featuring a special guest mix from Atomic Hooligan Tracklist Gym Class Heroes - Clothes Off (Rural Remix) Jay-Z - No Hook (Chew Fu Remix) M.I.A. - Boyz (Twelves Remix) Pharrell ft. Snoop - That Girl (DJA Docs Remix) Hellogoodbye - All of Your Love (Forrests Remix) Lady Tigra - Bass on the Bottom (Justin Kase Edit) Estelle and Kanye West - American Boy Peter, Bjorn, and John - Young Folks (Diplo Remix)\nShow #3\nDance Rock Radio Show #3 starts out with a bang and then follows up with exclusives of groups like the Atomic Hooligans. It's different from the other mixes in that it changes flow and direction at every corner. Enjoy! -CB Lyon This is the track list for DRR 3: Hellogoodbye - All of Your Love (Kimmy Pop Remix) Atomic Hooligans - I Don't Care Shout Out Louds - The Comeback (Big Slippa Remix) The Egg - Nothing (Dusty Kid Loves Rock Remix) Animal Machine - Persona (Para One Remix) Fox N' Wolf - Youth Alcoholic (Etienne De Crecy Remix) Hot Chip - Over and Over Blaqk Audio - Stiff Kittens (Morel's Pink Noise Mix) Sarah McLaughlin - Fumbling Toward Ecstasy (Junior Boys Remix)* -CB *(Sorry McLauglin was misspelled on the podcast as McLachlan\nShow #2\nDRR's second show is a bomb! Full of more amazing tracks you will never hear otherwise from Justice, Daft Punk, Feist, Nine Inch Nails, Alex Gopher, Hard-Fi, Goldfrapp and more! Tracklisting: Justice - D.A.N.C.E. Daft Punk - Human After All (Emperor Machine Remix) Nic Chagall - What You Need (Ncs Prelectric Mix) Feist - 1234 (Van She Remix) Nelson - I Say You Can't Stop (Data Remix) Nine Inch Nails - The Hand That Feeds (DFA Remix) Alex Gopher - The Game Hard-Fi - Suburban Knights (Alex Metric Remix) Goldfrapp - Strict Machine Aphex Twin - Windowlicker\nShow #1\nDance Rock Radio's first installment entitled, Show #1, is a special blend of rock music fused with dance music, lovers of both genres will be elated. It is a smooth mix of dance rock music mixed by C. B. Lyon! Tracklisting: The Killers - Read My Mind (Gabriel and Dresden Remix) (continued)	https://assets.podomatic.net/ts/b6/3b/c6/cheph2000/3000x3000_1858016.jpg	\N	\N
