788	http://chinoisfacile.podOmatic.com/rss2.xml	chinoisfacile	Angélique Su	Apprendre le chinois avec le podcast "ChinoisFacile". "ChinoisFacile" a été élu parmi les meilleurs podcasts de l’année 2008 tous genres confondus dans l’iTunes Store France. "ChinoisFacile " est une méthode audio d'apprentissage du chinois spécialement conçue pour les francophones, constituée de leçons hebdomadaires de type « podcast » au format MP3, téléchargeables sur ordinateur ou baladeur numérique du type iPod. Elle comprend trois séries de leçons. La  première série "Débutant/ ChinoisFacile" met l’accent sur le chinois parlé et permet aux débutants d’acquérir rapidement les rudiments nécessaires pour mener une conversation courante. Certaines leçons en audio-podcast sont gratuites et disponibles pour téléchargement. D’autres sont disponibles sur demande moyennant une participation aux frais. Le texte intégral des leçons au format PDF, comprenant à la fois la transcription phonétique et les caractères chinois simplifiés, est également disponible sur demande moyennant une participation aux frais. Une seconde série, "Un mot de chinois par jour/ChinoisFacile" est consacrée à l’apprentissage de l’écriture et du vocabulaire. Une troisième série, "Civilisation Chinoise/ChinoisFacile", lancée récemment et élaborée avec Radio Albatros 94.3(http://www.radio-albatros.com) , couvre les traditions, coutumes et cultures dévelopés et préservés en Chine, à Hongkong, Macao, Singapour et Taiwan, ainsi qu’au sein de la diaspora chinoise. Ce podcast est la propriété exclusive d'Angélique SU. Toute utilisation de ce podcast non conforme à sa destination, toute diffusion ou toute publication, totale ou partielle, est interdite sauf autorisation expresse d'Angélique SU ".	https://assets.podomatic.net/ts/49/11/34/chinoisfacile/3000x3000_1130330.jpg	\N	\N
