807	http://chriscaggsradio.podOmatic.com/rss2.xml	ShakeDown Radio Podcast	ShakeDown Radio Podcast	Legendary Radio DJ Chris Caggs Now On Shakedown Radio\n\nIf you go to any major city, you’ll see DJs headlining major concerts, festivals and more, DJs are at the top of the music world in our modern society and Chris Caggs is a force to reckon with in the radio jockeying industry of Australia as he is always in demand; thanks to loyal listeners who can’t get enough of his unique broadcasting techniques wherein he plays a mix of the best Hip-Hop, Dance and RnB tunes.\n\nChris Caggs started his radio career in July 1998 on Sydney’s Pump FM 99.3 in Killara on Sydney’s North Shore – hosting a program with Cameron Griffiths (Mista-C) called “Bedroom Vibes” on a Tuesday Night which consisted of a music format known as Slow Jam RnB on a station to claim themselves as the 1st Hip Hop and RnB Community Station in Australia. The station relaunched as 99.3fm followed in August 2000 Dance FM 94.5FM.\n\nThrough a unique broadcasting techniques that is taking radio broadcasting to a new heights, Shakedown Radio Podcast already debuted as the future of radio broadcasting. \n\nAt the last count, Chris Caggs have featured in over a dozen radio stations;\n\n· Groove FM 94.5FM & 96.9FM - Sydney Metro Wide\n· Groove FM 97.3FM - Brisbane Metro Wide\n· DJ-FM 87.6 Dance Radio - Sydney CBD, Inner Suburbs\n· 2RDJ-FM 88.1FM - Burwood Sydney\n· 2NSB-FM 99.3FM - Northside Radio - Chatswood Sydney\n· Pump FM 99.3FM - North Shore RnB/Dance Radio\n· STR8OUT Radio - Melbourne Dance Station\n· Mix It Up Radio - Brisbane - Talkback & Music Radio\n. ICR Radio - Fairfield Sydney - Urban/Dance\n. Mixxbosses Radio - Sydney - Hip Hop & RnB\n. Urban Movement Radio - Brisbane - Hip Hop & RnB\n. Liquid Radio - Sunshine Coast - Queensland - EDM & House\n. Starter FM - Sydney - EDM & House\n. Tune 1 Perth - EDM & House \n\nINTERVIEWS ARTICLES ON CHRIS CAGGS:\n-North Shore Times\n-The Queensland Independent\n-Scene Magazine Brisbane\n-Three D World Magazine Sydney\n-Revolver Mag\n-Groove ON MEDIA\n-The Music Network\n-Player FM\n-The Place Magazine (North Queensland)\n-Radio Info Newsletter\n-Request Magazine\n\nChris Coggs kick started his 20-year-old career in broadcasting as a radio DJ from 1998 via various Dance and RnB Community Radio Stations located in Sydney and Brisbane. His other interests include music, films, TV, surfing the net, socializing and travelling. He is an avid traveler who has visited 26 countries which include New Zealand, Pacific Islands, Asia, UK and Europe, among others.\n\nMusic Licensed by PLAY MPE www.plaympe.com , Global PR Pool www.globalprpool.com , Relish PR Factory, Platinum Delivery and Five Star Pro	https://i1-static.djpod.com/podcasts/shakedownradiopodcast/52617d_1400x1400.jpg	\N	\N
