1112	http://completeliberty.libsyn.com/rss	Complete Liberty Podcast	Wes Bertrand	Have you had it with politics-as-usual? Are you curious about why the vague notion of "public interest" is constantly forwarded by those who want to control you and your property?\n\nDo you yearn for a day when you are respected as an individual? Do you want to learn about the implications of self-ownership? Do you desire to live in a brilliantly better future?\n\nA dangerous myth perpetuates our political plight in America - the belief that we are free. In fact, scores of unjust laws violate our individual rights daily. We are taxed, regulated, and forced to fund governmentally monopolized services, and if we attempt to defend ourselves from any of these infringements, we are fined, arrested, punished, or even destroyed. We are no longer subjects to the King, but are we veritable slaves to the State? Most of us are afraid to answer this question, because it's easier to conform and pretend that the myth of our freedom is true. But living in fear and being obedient aren't the essence of the American spirit - embracing liberty is. \n\nComplete Liberty Podcast explains not only the sundry ills of statism, but also why political freedom is so important - and how we, as Americans, can achieve it.\n\nVisit the website of the book at www.completeliberty.com.	https://ssl-static.libsyn.com/p/assets/1/7/4/5/174565182524b87f/newitunes1400.jpg	\N	\N
