1228	http://cornerstonechapel.net/podcasts/collections/C02012013/C02012013-Audio.xml	Cornerstone Chapel - The Minor Prophets (Audio)	Cornerstone Chapel	The last twelve books of the Old Testament are known as "the Minor Prophets."  They are "minor" not because they are less important than the other Old Testament prophets, but because their messages are generally shorter and more succinct.  The Minor Prophets are filled with exhortations from men, moved by God, who spoke out against the social and cultural sins of their day.  They called people to repentance.  They challenged people to turn to God.  Sometimes their hearers heeded the message, and sometimes they did not.  And even though their voices have been silent for some 2,500 years now, their messages are timeless - God wants us to repent of sin and turn to Him!	http://cornerstonechapel.net/podcasts/collections/C02012013/images/C02012013-Audio.jpg	\N	\N
1229	http://cornerstonechapel.net/podcasts/collections/C11102010/C11102010-Audio.xml	Cornerstone Chapel - In Depth Study Of The Book Of Revelation (Audio)	Cornerstone Chapel	Jesus is coming again!  There are three times as many prophecies in the Bible concerning the second coming of Jesus than there are prophecies concerning His first coming.  In the book of Revelation, God pulls back the curtain and allows us to have a glimpse of things that are to come.  He shows us the Judgments, the Antichrist, the False Prophet, the rise and fall of the one-world economic and political system, and the Battle of Armageddon, to name a few scenes.  But He also shows us how He rescues the righteous before the Tribulation, how He saves those who repent during the Tribulation, and how He even dispatches an angel to proclaim the gospel around the world so that as many people as possible might accept the good news of Jesus Christ.  The closing chapters of Revelation are about the Second Coming of Jesus Christ and the amazing future that He promises for all who belong to Him!	http://cornerstonechapel.net/podcasts/collections/C11102010/images/C11102010-Audio.jpg	\N	\N
1230	http://cornerstonechapel.net/podcasts/collections/C12172012/C12172012-Audio.xml	Cornerstone Chapel - The Ten Commandments (Audio)	Cornerstone Chapel	The Ten Commandments have been, without a doubt, the most influential document upon human culture, in general, and upon American culture in particular - framing both the social and legal foundations of our American Society.  In Colossians 2:16-17 and Mark 7:18-23, we find that the ceremonial and dietary aspects of the Old Testament law are no longer binding; however, the moral code is still intact.  The Ten Commandments are the summary of God's moral code and are intended to shape the way we live - our actions, speech, and attitudes.  There are no exceptions to the moral code because it is an absolute, not a relative code.  In other words, it doesn't change because of changing times or cultural views; it expresses God's moral standard for human behavior toward God and toward others.	http://cornerstonechapel.net/podcasts/collections/C12172012/images/C12172012-Audio.jpg	\N	\N
