1555	http://danyb.podOmatic.com/rss2.xml	TSoNYC® - The Sound Of New York City®	TSoNYC® - The Sound of New York City®	"The Sound of New York City" is a project born from the idea of its founder back in 2006 to encourage the rediscovery of the Disco Sound, including Soul - Funk - House, while at the same time make use of my extensive vinyl collection, much of which was gathered from underground sources, dating back to 1975. \n\nIn December 2009 the initial project was transformed into a live, 24/7 web radio station:\nTSoNYC™ The Sound of New York City™. The station's programming is based on the history of New York's clubs like “Paradise Garage” and “The Loft”, with their protagonists Larry Levan and David Mancuso, as well as Detroit and Chicago with “The Warehouse” and “The Gallery”, where Frankie Knuckles and Ron Hardy spread their style. The TSoNYC sound includes Nu-Disco and Deep House, showcasing DJ contemporaries such as Moodymann, Danny Krivit, Theo Parrish, LTJ experience, and others who are now contributing to the rediscovery of this immortal music.\n\nThe growing interest for this genre of music is being demonstrated as our site last year reached more than 14 thousand visitors, with tremendous audiences tuning not only within the USA and Canada,but also in Germany, Greece, Japan, Russia, France, Poland, England and Italy as well.\n\nBe sure to check out our podcasts and new track releases on Facebook, iTunes and Podomatic.\n\nEach week international guest DJs perform exclusive mixes. Among some of the latest to be featured: Ashley Beedle (UK), Disco Dave (Sweden), Gilo (Italy), Gino Grasso (Italy), Jeff White (Chicago, USA), danyb (Italy), Joseph Colbourne (Boston, USA), Ly Sander (Switzerland), Nicholas (Italy), MichiNYC (Italy), Sauro Cosimetti (Italy), Soulparanos (France), Soulseduction (Greece), Katzuma (Italy), and many others will.\nThese then become mix podcasts that are downloaded more than 3500 times per month on average.\nThe radio can be reached directly from the website or the iTunes Radio under the category 70's music and Electronica\n\nStay Tuned...	https://assets.podomatic.net/ts/d2/61/94/danyb/pro/1400x1400_8955308.jpg	\N	\N
