1713	http://demokratie-goettingen.de/radio/unterderlupe.xml	Unter der Lupe - Ein Blick auf Politik und Gesellschaft	Unter der Lupe	Die Lupe im Namen steht für genaue, fundierte, wissenschaftliche Arbeit und ordnet sich\ndamit in die Tradition des Göttinger Instituts für Demokratieforschung ein. Sie impliziert einen kritischen,\nhinterfragenden, scharf beobachtenden Blick auf alles, was mit Demokratie zu tun hat. Folgerichtig wird in jeder\n"Unter der Lupe"-Sendung unter anderem eine wissenschaftliche Analyse, und ein Politikerinterview angeboten. Außerdem steht mit "Wissen in vier Minuten" eine Rubrik bereit,\nmit der wir unserer Aufgabe der Politischen Bildung nachkommen und monatlich neue Begriffe der Politik erklären. Die "Lokale Perspektive" ordnet das jeweilige Thema \nsystematisch und anschaulich für die lokale Ebene ein. In der Rubrik "Wiederentdeckt" fragen wir, was Politiker und andere gesellschaftlich relevante Personen nach ihrem Rückzug aus der \nÖffentlichkeit machen. Die Rubrik "frisch geforscht" arbeitet schlussendlich dezidiert neue Erkenntnisse aus Forschungsprojekten unseres Instituts auf und präsentiert diese in ansprechender,\nauf ein breites Publikum abzielender Form. Themen der Sendungen sind Parteipolitik - von konservativ bis grün, Soziale Bewegungen und politischer Protest,\nWahlen, Extremismus und Populismus, Intellektuelle und Charismatiker, Jugend und Politik etc. Interviewpartner u.a. Jürgen Trittin, Klaus von Dohnanyi, \nHans-Christian Ströbele, Franz Walter, Julian Nida-Rümelin u.a.	http://www.demokratie-goettingen.de/radio/Logo_Schrift_Grau-200x135.jpg	\N	\N
