2035	http://djdavereeves.podOmatic.com/rss2.xml	TENACIOUS PODCAST	Tenacious UK	**Welcome to The Tenacious Podcast**\nJoin us LIVE Every Thursday From 10pm & Monday from 1pm on London's Centreforce Radio 883 DAB.\n              \nABOUT US.\nFrom his very early school years all Dave wanted to do is play music, so after playing lots of private parties in the late 80's and DJ'ing in the local clubs, he very quickly got involved with the Kent Soul Festivals, which led on to securing his first ever radio show on Sunrise 88.75 in London. With a huge passion for the music and the buzz of doing radio show's, he had shows on many other stations too over the years including Juice FM, Flex FM, Pulse FM, Fresh Radio UK and most recently Select Radio. Dave was also resident for many events over the years including The Camber Weekenders, Seduction Allnighters in Margate and the The Seduction Weekender's in Great Yarmouth, The Caister Soul Weekender and The South Coast Weekenders at Pontins in Camber Sands, these were major events to be involved with over the years. Dave has also held weekly club residencies for many big nights which include The Devious Events, H20 at Cales, M20 in Ashford, Lydd Watersports and Club Class in Maidstone playing alongside some of the biggest names on the scene every week. Dave has also played on the White Isle in Ibiza many times for various events inc Judgement Sunday's, Coastline, Es Paradis and many more.\n\nAfter years of DJ'ing, Dave set up a recording studio with his younger brother Steve and close friend Lewis in 1998 and started making uplifting Trance. With a little bit of success over a few years under the name 'Aptness', and their biggest track called 'The Answer, which Graham Gold signed to his Good as label, went on to become one of Judge Jules's favourite tracks of 1998 and also Graham Gold's 'Kicking Cut' on Kiss. 'The Answer' also appeared on various mix albums including Ministry's 'Clubbers Guide to 99, Trance Nation 2 and many more including a footie Playstation game. During this time they also did a few remixes inc one of Tiesto's very early tracks called 'Theme from Norefjell'.\n\nWith ever changing scene of dance music over the years and the Trance scene becoming more and more commercial, in 2013 the lads decided to take their productions in a new direction and that's when the name Tenacious was born, focusing on Underground House Music and driving energetic Bass Driven Tech House. Since then Tenacious have had tracks and remixes signed and released on some quality independent dance labels such as PP Music, Hotfingers, Jeepers, Subteranneo, Influential House, Onefold DGTL, Summerized Sessions, Whorehouse Records, Tropical Velvet and many more.\n\nWatch out for Brand New Music Forthcoming in 2019 on Criminal Hype Records, Rising High Records, Sleazy Deep, Onefold DGTL, New State Music & Sexy Trash.\n\nCatch Tenacious Radio Show Every Thursday Night from 22.00 hrs (GMT) on Londons CentreForce Radio 883 DAB & Online.	https://assets.podomatic.net/ts/40/33/18/djdavereeves/pro/3000x3000_13887375.jpg	\N	\N
