2070	http://djeliascabuzz.podOmatic.com/rss2.xml	Funky House New York Style	DJ Elias CabuzZ	Dj Elias CabuzZ, Born in Brasilia, Elias CabuzZ initiated his career as a Dj in July of 2002 introducing Hip-Hop in the northeast of Brazil playing for 4 year's until change for House Music, and Create the Funky House New York Style. Since his early childhood Elias was always fascinated for music and his passion led him to work producing many projects and events that connected Brazilian culture to international trends in music. For 6 years Dj Elias CabuzZ showcased his talent throughout Brasil, playing in various states such as: Sao Paulo, Rio de Janeiro, Bahia, Ceara, Brasilia D.F., Paraiba, Rio grande do Norte, Tocantins, Piaui, Alagoas e Pernambuco, among others. In 2007, Elias decided to live in New York City for 6 months and invest in his career by taking an electronic music production course at SAE- Institute of Technology; he also had the opportunity to play in various clubs and events in the Big Apple scene. Since he always enjoyed a good challenge, he felt he should test his music talent and try a different beat, so he introduced house music in his Dj life and experimented with a set that became a hit. Elias CabuzZ has a degree in Marketing and Strategic Communication. Worked As an event planner for 15 years, furthermore he planned and produced plenty of events, such as: Festival de Verao do Recife( Recife Summer Festival) – The festival lasts 2 days in the Chevrolet Hall, and it brings national artists and bands such as: Ivete Sangalo, Marcelo D2, Timbalada, Chiclete com Banana, Barao Vermelho, the bands vary every year. This event drew about 120 thousand guests. For 5 years he has planned and played in the electronic tent which also hosts the most renowned Dj’s in the electronic scene. Such as: Carlos Dallanese(SP), Julio Torres(SP), Leozinho(GOA) e Rodrigo Parscionik(GOA), Bruno V.(PE), Rafael Correia (RN), Marcio zanzi(SP), Edu Brussi(SP) ,among others. Forro da 