2100	http://djherberttonn.podomatic.com/rss2.xml	DJ Herbert Tonn oficial	DJ HERBERT TONN	Em mais de 2 décadas de carreira, Herbert Tonn tornou-se referência como DJ e hoje é um dos nomes mais importantes da cena musical LGBT do Brasil.\n\nHá 24 anos é DJ RESIDENTE aos domingos, no club BLUE SPACE em São Paulo, sendo um dos únicos Djs brasileiros a ter uma residência num night club por tanto tempo.\n\nHá quase 5 anos faz parte do time de Djs residentes do selo brasileiro "GRUPO SUPERFESTAS", grupo que comanda algumas das festas e after parties mais importantes de SP, tais como: CODE After, BIGGER Party, JUNGLE Party, EUPHORIA After, BIG After, ENERGY After, HOT After, entre outras festas e festivais do Grupo. \n\nHá quase 5 anos é um dos DJs convidados de uma das maiores festas de SP, a URSOUND, selo respeitado em todo o Brasil, onde Herbert teve o prazer de fazer parte do line nos aniversários de 10 anos (Via Matarazzo), 11, 12 e 13 anos (AUDIO club SP).\n\nHerbert também esta presente no line da BIGGER PARTY, como Dj convidado, ao lado de grandes nomes da cena, uma festa que tornou-se reconhecida internacionalmente e sucesso nacional.\n\nSua experiência o torna um dos Djs brasileiros mais requisitados a fazer LONG SETS ou XTEND SETS, com habilidade para tocar durante muitas horas.\n\n\nSua história...\nBIOGRAFIA\n\nSua trajetória se início nos anos 90, junto com a evolução musical e tecnológica. Logo no início ele se tornou residente dos maiores clubs de SP, entre alguns estão: RAVE, MASSIVO, ULTRALOUNGE e BCBG.\n\nAinda nos anos 90, foi convidado para gravar um CD pela gravadora PARADOXX, o cd BODY CULTURE by Dj Herbert Tonn, o primeiro CD feito exclusivamente por uma gravadora voltado ao público LGBT, com turnê pelo Brasil em razão do sucesso de vendas, tornando-o conhecido em todo o país.\n\nEm meados dos anos 2000, Inaugurou o Programa FREEDOM na Rádio Energia 97fm e hoje participa como DJ convidado deste programa que até hoje é um grande sucesso.\n\nParticipou durante anos do FESTIVAL SPIRIT OF LONDON no Sambódromo do Anhembi, também comandado pela Rádio Energia 97fm SP.\n\nHerbert Tonn foi DJ residente por 9 anos do club THE WEEK (Junho de 2006 - Março de 2015), tendo tocado em Festivais importantes do grupo como ETERNA FESTIVAL, INCREDIBLE WEEK, ACQUAPLAY, CARNAVAL FLORIPA, REVEILLON FLORIPA, TOY, etc, além de inaugurações dos clubs THE SOCIETY e GRAND METROPOLE.\n\nSua carreira internacional conta com apresentações em Vigo (Espanha), em Amsterdam na PRIDE para o selo holandês RAPIDO, em MALAGA (Espanha) e MYKONOS (Grécia) no LA DEMENCE CRUISE do selo belga LA DEMENCE.\n\nEle também é convidado para viajar por todo o Brasil ?? para comandar as pick-ups dos mais importantes Clubs, Festivais , Pool Parties, Afters e Festas em geral. \n\nAlguns lugares por onde passou são: Belém (Pará), Manaus (Amazonas), Goiânia, Brasília, Salvador, Fortaleza, João Pessoa, Maceió, Rio de Janeiro, Belo Horizonte, Curitiba, Florianópolis, Volta Redonda (RJ), Santa Catarina, Macapá (Amapá), Campinas (SP), Ribeirão Preto (SP), São José dos Campos (SP), São José do Rio Preto (SP) e muitos outros.\n\n\nTRILHAS EXCLUSIVAS &\nEVENTOS CORPORATIVOS\n\nAlém de toda sua história na cena musical, ele também realiza um trabalho diferenciado da noite: ELABORAR CONCEITO MUSICAL e TRILHAS SONORAS para Produtos, Marcas, Hotéis, Restaurantes, Lojas, Desfiles, etc.\n\nDentre alguns trabalhos neste seguimento destaca-se o CONCEITO MUSICAL criado exclusivamente para o HOTEL PULLMAN, marca internacional de hotéis que chegou ao Brasil em 2011 e hoje conta com 3 hotéis em SP.\n\n“A sua habilidade em se conectar com o público, em qualquer pista ou evento, o torna único no que faz.”\n(AO assessoria)\n\nENJOY THE MUSIC!!\n\nwww.djherberttonn.podomatic.com\nwww.facebook.com/deejayherberttonn\nwww.twitter.com/djherberttonn\niTunes store: DJ HERBERT TONN\n\n.::: PARA CONTRATAR :::.\nWT CREATIVE COMMUNICATION\nAO ASSESSORIA\nADRIANA DE OLIVEIRA\nm a n a g e r\nwtassessoria@hotmail.com	https://assets.podomatic.net/ts/48/da/d7/djherberttonn/3000x3000_13312093.jpg	\N	\N
