2739	http://librivox.org/rss/2030	Frankenstein; or The Modern Prometheus (1818) by SHELLEY, Mary Wollstonecraft	LibriVox	Frankenstein; or, The Modern Prometheus is a novel written by the British author Mary Shelley. Shelley wrote the novel when she was 18 years old. The first edition was published anonymously in London in 1818, and this audiobook is read from that text. Shelley's name appeared on the revised third edition, published in 1831. The title of the novel refers to the scientist, Victor Frankenstein, who learns how to create life and creates a being in the likeness of man, but larger than average and more powerful. In modern popular culture, people have tended to refer to the Creature as "Frankenstein" (especially in films since 1931), despite this being the name of the scientist, and the creature being unnamed in the book itself. Frankenstein is a novel infused with elements of the Gothic novel and the Romantic movement. It was also a warning against the "over-reaching" of modern man and the Industrial Revolution, alluded to in the novel's subtitle, The Modern Prometheus. The story has had an influence across literature and popular culture and spawned a complete genre of horror stories and films. It is arguably considered the first fully-realised science fiction novel and raises many issues still relevant to today's society. (Summary from wikipedia.org, adapted by Cori Samuel.)	\N	\N	\N
